With(
    {
        invalidDate: {
            Code: 1,
            Text: $"Invalid date in '{GeneralInfoForm.PresentationData.DeadlineDate.Label}': the date provided must be later than or equal to the current date"
        },
        invalidDates: {
            Code: 2,
            Text: $"Invalid dates: '{GeneralInfoForm.PresentationData.StartDate.Label}' must be a date equal to or later than '{GeneralInfoForm.PresentationData.DeadlineDate.Label}'"
        },
        deadlineDate: datDeadlineDate_GeneralInfoForm.SelectedDate,
        startDate: datStartDate_GeneralInfoForm.SelectedDate
    },
    If(
        IsBlank(deadlineDate) || GeneralInfoForm.FormMode = FormMode.Edit,
        RemoveIf(
            Warnings,
            Code = invalidDate.Code || Code = invalidDates.Code
        ),
        If(
            !IsBlank(startDate) && DateDiff(
                deadlineDate,
                startDate
            ) < 0,
            Collect(
                Warnings,
                invalidDates
            ),
            RemoveIf(
                Warnings,
                Code = invalidDates.Code
            )
        );
        If(
            DateDiff(
                Today(),
                deadlineDate
            ) < 0,
            Collect(
                Warnings,
                invalidDate
            ),
            RemoveIf(
                Warnings,
                Code = invalidDate.Code
            )
        )
    )
)

